import React from 'react';
import { BrowserRouter as Routes } from 'react-router-dom';
import './App.css';
import Provedor from './contexto/Provedor';
import paginaPrincipal from './paginas/pagina-principal';

function App() {
  return (
    <Provedor>
        <Route path='/' component={ paginaPrincipal } />
    </Provedor>
  );
}

export default App;
